import React, { Component } from 'react';
import { Link, NavLink } from 'react-router-dom';
import { Nav, NavItem, Collapse, Navbar } from 'reactstrap';
import PropTypes from 'prop-types';

//import { AppAsideToggler, } from '@coreui/react';
//import logo from '../../assets/img/brand/logo.svg'
//import sygnet from '../../assets/img/brand/sygnet.svg'

const propTypes = {
  children: PropTypes.node,
};

const defaultProps = {};

class DefaultHeader extends Component {
  render() {

    // eslint-disable-next-line
    const { children, ...attributes } = this.props;

    return (
      <React.Fragment>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">ASMAS</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto d-md-down-none" navbar>
              <NavItem className="px-3">
                <NavLink to="/dashboard" className="nav-link" >AS+</NavLink>
              </NavItem>
              <NavItem className="px-3">
                <Link to="/eventos" className="nav-link">EVENTOS</Link>
              </NavItem>
              <NavItem className="px-3">
                <NavLink to="/beneficios" className="nav-link">BENEFICIOS</NavLink>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
      </React.Fragment>
    );
  }
}

DefaultHeader.propTypes = propTypes;
DefaultHeader.defaultProps = defaultProps;

export default DefaultHeader;
